<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
<title>Doraemon</title>
<script language="javascript" type="text/javascript">
var tmp = 1000;
function Time(year,month,day,divid){
	var now = new Date();
	var endtime = new Date(year,month-1,day);
	var sumtime = (endtime.getTime() - now.getTime());
	var leftsec = parseInt(sumtime/1000);
	var day1 = Math.floor(leftsec/(60*60*24));
	var hour = Math.floor((leftsec-day1*(60*60*24))/(60*60));
	var minite = Math.floor((leftsec-day1*(60*60*24)-hour*3600)/60);
	var second = (leftsec-day1*(60*60*24)-hour*3600-minite*60);
	var a = document.getElementById(divid);
	a.innerHTML = "距离"+year+"年"+month+"月"+day+"日还有"+day1+"天"+hour+"小时"+minite+"分"+second+"秒";
	
}

window.setInterval(function(){Time(2014,4,20,'test');}, tmp); 
</script>
